import { Test, TestingModule } from '@nestjs/testing';
import { AwsService } from './aws.service';
import { ModuleMocker, MockFunctionMetadata } from 'jest-mock';

const moduleMocker = new ModuleMocker(global);

describe('AwsService', () => {
  let service: AwsService;

  beforeEach(async () => {
    const module: TestingModule = await Test.createTestingModule({
      providers: [AwsService],
    })
      .useMocker((token) => {
        if (typeof token === 'function') {
          const mockMetadata = moduleMocker.getMetadata(
            token,
          ) as MockFunctionMetadata<any, any>;
          const Mock = moduleMocker.generateFromMetadata(mockMetadata);
          return new Mock();
        }
      })
      .compile();

    service = module.get<AwsService>(AwsService);
  });

  it('should be defined', () => {
    expect(service).toBeDefined();
  });

  describe('extractHeader', () => {
    it('should throw when header has invalid format', () => {
      expect(() => service.extractHeader(`invalid-format`)).toThrow();
    });

    it('should return header extension and encoding when png', () => {
      const header = service.extractHeader(
        `data:image/png;base64,`,
      );
      expect(header.encoding).toBe('base64');
      expect(header.extension).toBe('png');
    });
    it('should return content when encoding is png', () => {
      const header = 'data:image/png;base64';
      const data = 'data';
      const imageBase64 = `${header},${data}`;
      expect(service.extractData(imageBase64)).toBe(data);
    });

    it('should return header extension and encoding for common use case', () => {
      const header = service.extractHeader(
        `data:image/jpeg;base64,`,
      );
      expect(header.encoding).toBe('base64');
      expect(header.extension).toBe('jpeg');
    });
  });

  describe('extractData', () => {
    it('should throw when invalid format', () => {
      expect(() =>
        service.extractData('/9j/4AAQSkZJRgABAQAAAQABAAD...'),
      ).toThrow();
    });

    it('should return data when valid format', () => {
      const header = 'data:image/jpeg;base64';
      const data =
        '';
      const imageBase64 = `${header},${data}`;
      expect(service.extractData(imageBase64)).toBe(data);
    });
  });
});
